import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet, View} from 'react-native';
import BarChart from './components/BarChart';
import {default as CardDisplayV} from './components/cards';
import DonutChartV from './components/donutChart';
import LineChartV from './components/LineChart';
import RadarChart from './components/RadarChart';
import TimeLineV from './components/timelineV';

export type dashBoardProps = {
  graphData?: any;
};

const Mystyle = {
  backgroundColor: {
    backgroundColor: '#eee',
  },
  chartstyle: {
    backgroundColor: 'white',

    marginLeft: '65px',
    borderRadius: '5px',
    padding: '10px',
  },
  timeline: {
    borderRadius: '5px',
  },
  containerPos: {
    marginLeft: '-45px',
  },
};

const DashboardV = (props: dashBoardProps) => {
  const getcard = () => {
    const output: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items?.type === 'cardData')
          output.push(
            <Grid container style={StyleSheet.flatten([items?.styles])}>
              <CardDisplayV cardData={items?.data} />
            </Grid>,
          );
      });
    return output;
  };
  const getTimeline = () => {
    const output: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items.type === 'timelinedata') {
          output.push(
            <Grid
              item
              md={items?.mediumDevice}
              sm={items?.smallDevice}
              style={StyleSheet.flatten([items?.styles])}
            >
              <TimeLineV timelinedata={items?.dataset} />
            </Grid>,
          );
        }
      });
    return output;
  };
  const getLineChart = () => {
    const output: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items.type === 'lineChartData') {
          output.push(
            <Grid
              item
              md={items?.mediumDevice}
              sm={items?.smallDevice}
              style={StyleSheet.flatten([items?.styles])}
            >
              <LineChartV lineChartData={items?.data} />
            </Grid>,
          );
        }
      });
    return output;
  };

  const _getRadarChart = () => {
    const cardsecoutput: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items?.type === 'radarchart') {
          cardsecoutput.push(
            <Grid
            md={4}
            spacing={3}
            justify="center"
            style={{backgroundColor:"white",padding:"25px 50px 75px 75px"}}
            >
              <RadarChart RadarChartData={items?.data} />
            </Grid>,
          );
        }
      });
    return cardsecoutput;
  };

  const getdonutChart = () => {
    const output: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items?.type === 'donutchart')
          output.push(
            <Grid
            md={4}
            spacing={3}
            justify="center"
            style={{backgroundColor:"white",padding:"25px 50px 75px 75px"}}
            >
              <DonutChartV donutchartdata={items?.data} />
            </Grid>,
          );
      });
    return output;
  };

  const getbarChart = () => {
    const output: any = [];
    Array.isArray(props?.graphData) &&
      props?.graphData.forEach(items => {
        if (items?.type === 'barchart')
          output.push(
            <Grid
              md={3}
              justify="center"
              style={{backgroundColor:"white",}}
            >
              <BarChart
                BarChartData={items?.data}
                barChartOptions={items?.data?.barChartOptions}
              />
            </Grid>,
          );
      });
    return output;
  };

  return (
    <View style={StyleSheet.flatten([Mystyle.backgroundColor])}>

      <Grid container  >



              {getcard()}

              {getTimeline()}

              {getLineChart()}
            {_getRadarChart()}
            {getdonutChart()}
            {getbarChart()}
      </Grid>

    </View>
  );
};

export default DashboardV;




